// src/components/Categories.js
import React from 'react';

const Categories = () => {
  return (
    <div className="section categories">
      <h2>Categories</h2>
      <div className="books">
        <div className="book-card">
          <h3>Fiction</h3>
        </div>
        <div className="book-card">
          <h3>Science</h3>
        </div>
        <div className="book-card">
          <h3>History</h3>
        </div>
      </div>
    </div>
  );
};

export default Categories;
